class Solution:
    def longestDupSubstring(self, s: str) -> str:
        #  这算法时间复杂度不够 能过 65/67
        n = len(s)

        substring_dict = {}
        left, right = 0, n
        sub = ""
        while left <= right:
            is_changed_left = False
            length = (right + left) // 2
            for j in range(n - length + 1):
                if s[j:j + length] not in substring_dict:
                    substring_dict[s[j:j + length]] = 1
                else:
                    left = length + 1
                    sub = s[j:j+length]
                    is_changed_left = True
                    break
            if not is_changed_left:
                right = length - 1
            print(left, right)

        return sub


s = ""
sol = Solution()
print(sol.longestDupSubstring(s))
